// 遍历字符串
// 保存每个字符的最长不重复字符串, 用对象保存
// 比较保存的字符串长度
/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function (str) {
    if (str.length >= 1 && str.trim() === '') return 1;
    if (!str) return 0;
    if (str.length === 1) return 1;

    const strSet = new Set();
    let max = 0;
    let index = 0;

    for (let i = 0; i < str.length; i++) {
        const item = str[i];

        if (strSet.has(item)) {
            // Move index
            while (true) {
                const curr = str[index];
                if (curr === item) {
                    index++;
                    break;
                }
                else {
                    strSet.delete(curr);
                    index++;
                }
            }
        }
        else {
            strSet.add(item);
        }
        max = Math.max(max, strSet.size);
    }

    return max;
};


